      "get": {
        "summary": "Scholar Search",
        "description": ":param query: Search query.\n:param language: language code. Use zh-cn if Chinese.\n:param year_start: Start year.\n:param year_end: End year.\n:param sorted: Sort by relevance or date.",
        "operationId": "scholar_search_scholarGPT_scholar_get",
        "parameters": [
          {
            "name": "query",
