            "required": true,
            "schema": {
              "type": "string",
              "title": "Query"
            }
          },
          {
            "name": "language",
            "in": "query",
            "required": false,
            "schema": {
              "type": "string",
              "default": "en",
              "title": "Language"
            }
          },
          {
            "name": "time",
            "in": "query",
            "required": false,
            "schema": {
              "type": "string",
              "title": "Time"
            }
          },
          {
            "name": "year_start",
            "in": "query",
            "required": false,
            "schema": {
              "type": "integer",
              "title": "Year Start"
            }
          },
          {
            "name": "year_end",
            "in": "query",
            "required": false,
            "schema": {
              "type": "integer",
              "title": "Year End"
            }
          },
          {
            "name": "sorted",
            "in": "query",
            "required": false,
            "schema": {
              "type": "boolean",
              "default": false,
              "title": "Sorted"
            }
          }
        ],
        "responses": {
